import React from 'react';
import { StartMenu, StartButton } from './styles/MenuStyles';

class Menu extends React.Component {
    handleClick() {
        StartMenu.gameStarted = true;
    }
    render() {
        return (
            <StartMenu>
                <StartButton onClick={handleClick()}>Start</StartButton>
            </StartMenu>
        )
    }
}

export default Menu;
